import React from "react";
import "./CanValuesCard.css";
import MotorComponent from "./MotorComponent";

/**
 * CanValuesCard Component
 * Displays CAN bus values including motor data, pedal inputs, and control states
 * 
 * @param {object} canValues - Object containing motor temp and current
 * @param {number} canValues.motorTemp - Motor temperature in °C
 * @param {number} canValues.current - Current draw in Amps
 * @param {object} motorData - Object containing motor control and telemetry data
 * @param {boolean} motorData.breaking - Is braking active
 * @param {boolean} motorData.cruise - Is cruise control active
 * @param {boolean} motorData.manual - Is manual mode active
 * @param {number} motorData.throttlePedal - Throttle pedal position (0-100)
 * @param {number} motorData.brakePedal - Brake pedal position (0-100)
 * @param {number} motorData.throttle - Throttle output percentage
 * @param {number} motorData.motorRPM - Motor RPM
 */

const CanValuesCard = ({ canValues, motorData = {} }) => {
  const {
    breaking = false,
    cruise = false,
    manual = false,
    throttlePedal = 0,
    brakePedal = 0,
    throttle = 0,
    motorRPM = 0,
  } = motorData;

  return (
    <div className="can-values-container">
      <h2>CAN Bus Values</h2>

      {/* Temperature and Current Metrics */}
      <div className="can-metrics">
        <div className="can-metric-card temp">
          <p>Motor Temperature</p>
          <h3>{canValues.motorTemp} °C</h3>
        </div>
        <div className="can-metric-card current">
          <p>Current Draw</p>
          <h3>{canValues.current} A</h3>
        </div>
      </div>

      {/* Motor Control Component */}
      <MotorComponent
        breaking={breaking}
        cruise={cruise}
        manual={manual}
        throttlePedal={throttlePedal}
        brakePedal={brakePedal}
        throttle={throttle}
        motorRPM={motorRPM}
      />
    </div>
  );
};

export default CanValuesCard;
